import React from "react";
import { View, StyleSheet, Text } from "react-native";
import VerifyFloatingButton from "../assets/VerifyFloatingButton";
import MyTabs from "../navigation/BaseNavigationService";

const Mainpage = ({}) => {
  return (
    // Try setting `flexDirection` to `column`.

    <View
      style={{
        flex: 1,
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "space-around",
      }}
    >
      <Text> Toolbar</Text>
      <View
        style={{
          shadowColor: "black",
          flex: 3,
          shadowOpacity: 0.3,
          elevation: 0.1,
          justifyContent: "center",
          alignContent: "center",
          borderRadius: 30 / 2,
        }}
      >
        <Text style={{ fontSize: 15, padding: 10 }}>Seek the information</Text>
        <Text>Total number of Jab certificates : 15</Text>
      </View>

      <View
        style={{
          shadowColor: "black",
          shadowOpacity: 0.3,
          elevation: 0.1,
          flex: 2,
          justifyContent: "center",
          alignContent: "center",
          borderRadius: 60 / 2,
        }}
      >
        <Text style={{ fontSize: 15, padding: 10 }}>Seek the information</Text>
        <Text>Total number of Jab certificates : 15</Text>
      </View>

      <VerifyFloatingButton />
    </View>
  );
};

export default Mainpage;
